<body>
  <div class="container">
    <h1>JS 对象 Proxy 检测工具</h1>
    <p class="description">
      本页面用于检测任意 JavaScript 对象或函数是否为 Proxy 对象。<br/>
      在下方输入表达式（例如 <code>new Proxy({}, {})</code>），然后点击“检测”即可。<br/>
	  开发者工具下调用【is_proxy】测试会更加直观。
    </p>

    <div class="input-group">
      <label for="expression">待检测表达式</label>
      <input type="text" id="expression" value="{}" />
    </div>

    <div class="examples">
      <button type="button" data-expr="{}">普通对象 { }</button>
      <button type="button" data-expr="new Proxy({}, {})">Proxy 对象</button>
      <button type="button" data-expr="function(){}">普通函数</button>
      <button type="button" data-expr="new Proxy(function(){}, {})">Proxy 函数</button>
    </div>

    <button id="testBtn">检测 is_proxy(expr)</button>

    <div id="result">结果将在此处显示</div>

    <ul class="note">
	  <li>● <code>is_proxy(target)</code> 函数源码加入星球获取：
	  <a href="https://t.zsxq.com/198W5iBjo" target="_blank" rel="noopener noreferrer">https://t.zsxq.com/198W5iBjo</a></li>
      <li>● 为了安全和简洁，脚本通过 <code>eval</code> 执行输入表达式，使用时请保证来源可信。</li>
      <li>● 本工具仅用于示例演示，不建议在生产环境中直接使用 <code>eval</code>。</li>
    </ul>
  </div>
